import React, { Component } from "react";
import "./Img.css";

class Img extends Component {
  state = {};
  render() {
    return (
      <div className="container">
        <div className="content">
          <div className="content-overlay"></div>
          <img className="content-image" src={this.props.image}></img>
          <div className="content-details fadeIn-top">
            <img src="https://previews.123rf.com/images/fokaspokas/fokaspokas1803/fokaspokas180300333/96943471-simple-eye-icon-white-icon-with-shadow-on-transparent-background-.jpg"></img>
            <h3>{this.props.title}</h3>
            <div class="line"></div>
          </div>
        </div>
      </div>
    );
  }
}

export default Img;
